import React from "react";

function Timp(props) {
  return (
    <>
      Timp trecut: {props.DigitFour % 10}:{props.DigitThere % 10}:{props.DigitTwo % 10}:
      {props.DigitOne}:
    </>
  );
}

let counter = 0;

export default Timp;
